import React from "react";
import style from "./BlockIMG.module.css";

function BlockIMG() {
  return;
  <div className={style.blockIMG}>
    <img src="ваш_путь_к_картинке.jpg" alt="Ваше изображение"></img>
  </div>;
}

export default BlockIMG;
